As a young couple embarks upon their wedding plans, gruesome secrets from their past collide with sinister forces of the present to ensure these newlyweds do not live &quot;happily-ever-after.&quot;

Director: Darin Scott
Writers: Joe Colleran (screenplay), Joseph Mungra (story)
Stars: Brittany Murphy, Julian Morris, Shantel VanSanten
Genres: Drama | Horror | Mystery | Thriller
Country: USA
Language: English

